package classpractis;

public class numbersample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		  for(int i=1;i<6;i++)
	        {
	        
	        for(int j=1;j<6;j++)
				
			{      
				System.out.print(i*j+" ");
				
			}
	        System.out.println();
	        

	}

}
}
